        // [\n        //     &quot;import&quot;,\n        //     {\n        //         &quot;libraryName&quot;: &quot;antd&quot;,\n        //         &quot;style&quot;: true,\n        //         &quot;libraryDirectory&quot;: &quot;es&quot;\n        //     }\n        // ],\n        // [\n        //     &quot;import&quot;,\n        //     {\n        //         &quot;libraryName&quot;: &quot;zerod&quot;,\n        //         &quot;style&quot;: false,\n        //         &quot;libraryDirectory&quot;: &quot;components&quot;,\n        //         &quot;camel2DashComponentName&quot;: false\n        //     }\n        // ],\n        // [\n        //     &quot;prismjs&quot;,\n        //     {\n        //         &quot;languages&quot;: [&quot;javascript&quot;, &quot;scss&quot;, &quot;jsx&quot;,&quot;json&quot;,&quot;yaml&quot;],\n        //         &quot;plugins&quot;: [&quot;line-numbers&quot;],\n        //         &quot;theme&quot;: &quot;tomorrow&quot;,\n        //         &quot;css&quot;: true\n        //     }\n        // ]</code></pre>\n<h2 id="-config-index-js-babel-polyfill-ant-design-false">在 config/index.js 中, 去掉 &quot;babel-polyfill&quot;,将&quot;ant.design&quot;改为 false</h2>\n<pre><code class="language-js">const config = {\n    //入口js\n    entry: {\n        app: [&quot;./src/main.js&quot;],\n    },\n    // entry: {\n    //     app: [&quot;babel-polyfill&quot;, &quot;./src/main.js&quot;],\n    // },\n    copyName: shareName,\n    //babel-loader 要包含的文件夹是哪些\n    &quot;babel-includes&quot;: [\n        ...new Set([\n            &quot;src&quot;,\n            &quot;node_modules/zerod&quot;,\n            `node_modules/${shareName}`,\n            &quot;node_modules/webpack-dev-server/client&quot;,\n        ]),\n    ],\n    //是否使用了ant design 组件库，管理theme，当用于微信等移动端开发时请设置为false\n    &quot;ant.design&quot;: false,\n    // &quot;ant.design&quot;: true,</code></pre>\n<h2 id="-postcssrc-js-viewportwidth-viewportheight-">移动端自适应方案：在.postcssrc.js 中，用如下 代码框的配置 替换全部，再修改 viewportWidth 和 viewportHeight 对应设计稿的宽度和高度</h2>\n<h3 id="-rem-rem-vw-vh-vm-">移动端自适应，以前用rem加媒体查询来做自适应，如今，rem方式也完成了它的历史使命，改用vw、vh 、vm等视窗单位</h3>\n<h3 id="-px-postcss-px-">但是我们在项目依然用<code>px</code>单位来写，使用postcss的插件自动将px转成视窗单位</h3>\n<h3 id="-">最后还要安装插件包：</h3>\n<p><code>npm install postcss-aspect-ratio-mini postcss-write-svg postcss-preset-env postcss-px-to-viewport cssnano cssnano-preset-advanced --save-dev</code></p>\n<pre><code class="language-js">// 容器适配，可以使用vw\n// 文本的适配，可以使用vw\n// 大于1px的边框、圆角、阴影都可以使用vw\n// 内距和外距，可以使用vw\n\nmodule.exports = {\n    plugins: {\n        &quot;postcss-import&quot;: {},\n        &quot;postcss-url&quot;: {},\n        &quot;postcss-aspect-ratio-mini&quot;: {},\n        &quot;postcss-write-svg&quot;: { utf8: false },\n        &quot;postcss-preset-env&quot;: { stage: 0, autoprefixer: { grid: true } },\n        &quot;postcss-px-to-viewport&quot;: {\n            viewportWidth: 419, // (Number) 设计稿的宽度（标准像素）.\n            viewportHeight: 741, // (Number) 设计稿的高度（标准像素）.\n            unitPrecision: 3, // // 指定`px`转换为视窗单位值的小数位数（很多时候无法整除）\n            viewportUnit: &quot;vw&quot;, //指定需要转换成的视窗单位，建议使用vw\n            selectorBlackList: [&quot;.not-vw&quot;, /^.weui-/, &#39;[class^=&quot;weui&quot;]&#39;], // 指定不转换为视窗单位的类，可以自定义，可以无限添加,建议定义一至两个通用的类名\n            minPixelValue: 1, // 于或等于`1px`不转换为视窗单位，你也可以设置为你想要的值\n            mediaQuery: false, // 允许在媒体查询中转换`px`\n        },\n        // &quot;postcss-viewport-units&quot;: {},\n        cssnano: {\n            preset: &quot;advanced&quot;,\n            autoprefixer: false,\n            &quot;postcss-zindex&quot;: false,\n        },\n        // to edit target browsers: use &quot;browserslist&quot; field in package.json\n        // &quot;autoprefixer&quot;: {}\n    },\n};\n</code></pre>\n<h2 id="-index-html-">在 index.html 中,用如下模板替换（这个模板只是参考）</h2>\n<pre><code class="language-html">&lt;!DOCTYPE html&gt;\n&lt;html&gt;\n\n&lt;head&gt;\n  &lt;meta charset=&quot;utf-8&quot;&gt;\n  &lt;meta name=&quot;viewport&quot; content=&quot;width=d